import "./login.css";

export default function Login() {
  return (
    <div className="login">
      <form className="loginForm">
        <label>ID</label>
        <input type="text" className="loginInput"></input>
        <label>PASSWARD</label>
        <input type="text" className="loginInput"></input>
        <button className="loginButton">Login</button>
        <img
          className="headerImg"
          src="https://gearbox.imgix.net/https%3A%2F%2Fix-www.imgix.net%2Fsolutions%2Fbeach.jpg?w=1782&h=982&fit=crop&ixlib=js-2.0.0&s=696f7285735b866832b0d79abb471548"
          alt=""
        ></img>
      </form>
    </div>
  );
}
